ur life. Learn more about following Jesus: https://bit.ly/41C04cE  \n \nDuring His time on earth, Jesus performed many miracles. The story of Jesus healing a blind man, found in the Bible in John 9:1-41, teaches us a lesson that faith requires more than just witnessing a miracle.  \n \nSome of the Pharisees, hearing the testimony of a man who had been blind from birth but could now see, still refused to believe that Jesus Christ was the Son of God. But there are other people throughout history who have believed in Jesus Christ as the Savior of the world without seeing Him heal a blind man. You can build your own faith in Jesus day by day through studying His words in the scriptures and following His commandments. Learn how with missionaries: https://bit.ly/41C04cE  \n \nThis video is part of a series of Bible videos created by The Church of Jesus Christ of Latter-day Saints to help people come closer to Jesus Christ. Watch more Bible videos here: www.BibleVideos.org \n \nFor more Christ-centered videos and other inspiration, follow The Church of Jesus Christ of Latter-day Saints on social media: \n\n Follow The Church of Jesus Christ of Latter-day Saints on:\nInstagram: /churchofjesuschrist\nFacebook: /churchofjesuschrist\nX: https://x.com/ch_jesuschrist\nWeb: https://www.churchofjesuschrist.org/?...","commandRuns":[{"startIndex":91,"length":22,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCAQ040EGAYiEwjAw4fR7MKSAxVmDGgIHbNYNblIlMPdteSdmrgMygEEj48SuA==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbUFzZGVkSGp6MVRyanhFUG9rSThpZ1F2UFk3QXxBQ3Jtc0tuRmxuMGUzVWdzc2tKak9KWFFYQlBaeWduV3VScG9TcV9abnJwdk1qbW9Rc0NvWXVVWlpQM2p5T2pJZTNOTTlQVlBZVDh1VFNsbkdQM0xCanNDeU5SWEUzT1F0N2dwUDhhVHBMZWVIdE5OYlN1T0U5QQ\u0026q=https%3A%2F%2Fbit.ly%2F41C04cE\u0026v=DHBo7ka3YZQ","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_descri ld without seeing Him heal a blind man. You can build your own faith in Jesus day by day through studying His words in the scriptures and following His commandments. Learn how with missionaries: https://bit.ly/41C04cE  \n \nThis video is part of a series of Bible videos created by The Church of Jesus Christ of Latter-day Saints to help people come closer to Jesus Christ. Watch more Bible videos here: www.BibleVideos.org \n \nFor more Christ-centered videos and other inspiration, follow The Church of Jesus Christ of Latter-day Saints on social media: \n\n Follow The Church of Jesus Christ of Latter-day Saints on:\nInstagram: /churchofjesuschrist\nFacebook: /churchofjesuschrist\nX: https://x.com/ch_jesuschrist\nWeb: https://www.churchofjesuschrist.org/?...","commandRuns":[{"startIndex":91,"length":22,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCAQ040EGAYiEwjAw4fR7MKSAxVmDGgIHbNYNblIlMPdteSdmrgMygEEj48SuA==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbUtKWHZ3bXpWcjVHbTRUb3pycFBVVDRxX2c5d3xBQ3Jtc0tueHJQZlcyQzc4RElodTl3MUtHZmw2U3pXQWNxZFNGVE5qU0xOeUVENUVMVktqcGpVZURuTEEtVXZ1VDgyLUJnLXhjdzR5VFctVEJnS1BYc0xlQTNoT2ZnSkJ5NVFmU0R2VmtiOHdIaGkzT29hY2k2WQ\u0026q=https%3A%2F%2Fbit.ly%2F41C04cE\u0026v=DHBo7ka3YZQ","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbUtKWHZ3bXpWcjVHbTRUb3pycFBVVDRxX2c5d3xBQ3Jtc0tueHJQZlcyQzc4RElodTl3MUtHZmw2U3pXQWNxZFNGVE5qU0xOeUVENUVMVktqcGpVZURuTEEtVXZ1VDgyLUJnLXhjdzR5VFctVEJnS1BYc0xlQTNoT2ZnSkJ5NVFmU0R2VmtiOHdIaGkzT29hY2k2WQ\u0026q=https%3A%2F%2Fbit.ly%2F41C04cE\u0026v=DHBo7ka3YZQ","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":796,"length":22,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCAQ040EGAYiEwjAw4fR7MKSAxVmDGgIHbNYNblIlMPdteSdmrgMygEEj48SuA==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/
